import React from "react";
const Home = () => {
	const [dataRecipe, setDataRecipe] = useState("Empty");

	useEffect(() => {
		fetch("https://www.themealdb.com/api/json/v1/1/random.php")
			.then((res) => res.json())
			.then((recipe) => {
				console.log(recipe);
				console.log("hello");
				setDataRecipe(recipe.meals);
			});
	}, []);

	return (
		<div>
			<h1>Welcome on My Social Network</h1>
			<p>
				This website is a training to Redux and React. We use auth and routing to
				create a small social media website.
			</p>
			<h3>List of posts:</h3>
		</div>
	);
};
export default Home;
